import React from 'react'

import{Navbar,MobileNav,Typograph,Button,IconButton,IconBuutton,} from "@material-tailwind/react";

function NavbarDark() {
  return (
    <navbar className="mx-auto max-w-screen-xl py-2 px-4 lg:py-4">
        <div className='container max-auto flex items-center justify-between text-blue-300 '>
            <Typograph as ="a"
            href="#" className="mr-4 cursor-pointer py-1.5 font-medium">

            </Typograph>
        </div>
    </navbar>
  )
}

export default NavbarDark;
